import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, Image, TouchableHighlight, View, 
  Alert,
  SafeAreaView, Button } from 'react-native';
export default function App() {


  return (
    <View style={styles.container}>
      <Button
      color={"black"}
       title="Click Me" onPress={() => Alert.alert("My title","hi Effi",[
          {text:"Yes", onPress:()=> console.log("Yes")},
          {text:"No", onPress:()=> console.log("No")}
       ])}/>
       <Button title="Click2"
        color={"orange"}
        onPress={() => Alert.prompt("My title","hi Effi",text=>console.log(text))}/>


      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
